	function backpacksearchquery(ite, s_quality = true, s_aussi = true, s_classes = false, s_killstreak = true, s_sheen = false, s_killstreakeffect = false, s_particleeffect = true, s_paint = false, s_skin = true, s_wear = false, s_level = false){
		let query = "?item=";
		let it = $(ite);
		let defindex = it.attr("data-defindex");
		let itemname = $($.parseHTML(it.attr("data-title"))).text();
		let defindexitemname = defindexes[defindex];
		query += defindexitemname;
		let classes = it.attr("class");
		if(s_quality)
		{
			let qu = /(?:quality)[0-9]+/g;
			let quals = classes.match(qu);
			if(quals.length > 0) query+="&quality=";
			for(let i=0; i < quals.length; i++) {
				quals[i] = quals[i].replace("quality", '');
				query+= quals[i]+ "%2C";
			}
			query = query.replace(/%2C$/g,"");
		}
		if(s_aussi) (itemname.toLowerCase().indexOf("australium") !== -1) ? query+="&australium=1" : query+="&australium=-1";

		if(s_killstreak) (classes.indexOf("killstreak1") !== -1) ? query+="&killstreak_tier=1" : (classes.indexOf("killstreak2") !== -1) ? query+="&killstreak_tier=2" : (classes.indexOf("killstreak3") !== -1) ? query+="&killstreak_tier=3" : query+="&killstreak_tier=0";

		if(s_classes)
		{
			let tfclasses = it.attr("data-classes");
			query+="&class="+tfclasses.replace(/ /g, "%2C");
		}
		if(s_paint)
		{

			it.find(".paintcolor").css("background-color");
			let paint =rgbToHex(it.find(".paintcolor").css("background-color"));
			let paintint =  parseInt(paint.split("#")[1],16);
			if(paintint >0) query+="&paint="+paintint;
		}
		if(s_particleeffect)
		{
			let effectid = it.css("background-image").match(/particles_440\/([0-9]+)_380/g);
			if(effectid !== null) {
				effectid = effectid[0].split("particles_440/")[1].split("_380")[0];
				query+="&particle="+effectid;
			}
		}
		if(s_sheen || s_killstreakeffect)
		{
			let sheenid = classes.match(/fx([0-9]+)/g);
			if(sheenid !== null) {
				for(let i=0; i < sheenid.length; i++) {
					sheenid[i] = parseInt(sheenid[i].replace("fx", ''));
					if(sheenid[i]>2000)
						if(s_killstreakeffect) query+="&killstreaker="+sheenid[i];
						else
							if(s_sheen) query+="&sheen="+sheenid[i];
				}
			}
		}
		if(s_skin || s_wear) {

			let tmp = itemname.split(" "+defindexes[defindex]+" ");
			if(tmp.length >= 2){
				let wear = tmp[1].replace(/\(|\)/g, "");
				let skin  = tmp[0].replace(/Collector's |Decorated Weapon |Genuine |Haunted |Normal |Self-Made |Strange |Unique |Unusual |Vintage /g, "");
				if(s_skin) query+="&skin="+skin;
				if(s_wear) query+="&wear="+wear;
			}

		}
		if(s_level){
			let level = it.attr("data-content").match(/Level ([0-9])/g);
			if(level != null) query+="&numeric=level&value="+level[0].split("Level ")[1];

		}
		return query.replace(/ /g, "+");

	}


	$("head").append('<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/jquery-contextmenu/2.6.3/jquery.contextMenu.css" crossorigin="anonymous">');



	$('.item').on('mousedown', function(e) {

		if( e.which == 2 ) {
			e.preventDefault();
			$(e.target).contextMenu();
		}

		// or $('.context-menu-one').trigger("contextmenu");
		// or $('.context-menu-one').contextMenu({x: 100, y: 100});
	});

	$.contextMenu({
		// define which elements trigger this menu
		selector: ".item",
		trigger: 'none',
		// define the elements of the menu
		items: {
			history: {name: "Item History", callback: function(key, opt){ window.open("https://backpack.tf/item/"+$(this).attr("data-id")); }},
			classifieds: {name: "Check Classifieds", callback: function(key, opt){

			let query = "https://backpack.tf/classifieds"+ backpacksearchquery(this);
				window.open(query);



			}},
			classifieds2: {name: "Check Classifieds (Accurate)", callback: function(key, opt){
				let query = "https://backpack.tf/classifieds"+ backpacksearchquery(this, true, true, true, true, true, true, true, true, true, true)

				window.open(query);

			}},
			premsearch: {name: "Premium Search", callback: function(key, opt){

			let query = "https://backpack.tf/premium/search"+ backpacksearchquery(this);
				window.open(query);



			}},
			premsearch2: {name: "Premium Search (Accurate)", callback: function(key, opt){
				let query = "https://backpack.tf/premium/search"+ backpacksearchquery(this, true, true, true, true, true, true, true, true, true, true, true)

				window.open(query);

			}},
			marketplace: {name: "Item on Marketplace.tf", callback: function(key, opt){
				let query = "https://marketplace.tf/items/";
				let it = $(this);
				let defindex = it.attr("data-defindex");
				let itemname = $($.parseHTML(it.attr("data-title"))).text();
				let defindexitemname = defindexes[defindex];
				//Item
				query += defindex;
				let classes = it.attr("class");
				let qu = /(?:quality)[0-9]+/g;
				let quals = classes.match(qu);
				//Quality
				query += ";"+quals[0].replace("quality", '');


				let effectid = it.css("background-image").match(/particles_440\/([0-9]+)_380/g);
				if(effectid !== null) {
					effectid = effectid[0].split("particles_440/")[1].split("_380")[0];
					//Effect
					query+=";u"+effectid;
				}

				(classes.indexOf("killstreak1") !== -1) ? query+=";kt-1" : (classes.indexOf("killstreak2") !== -1) ? query+=";kt-2" : (classes.indexOf("killstreak3") !== -1) ? query+=";kt-3" : query+="";





				let skininfo = it.css("background-image").match(/warpaint\/[0-9]+_[0-9]+_[0-9]+_[0-9]+\.png/g);
				if(skininfo !== null){
                  let skin = skininfo[0].split("_")[1]
				  let wear = skininfo[0].split("_")[2]
				  query+=";pk"+skin+";w"+wear;
				}

				if(it.attr("data-content").indexOf("Strange Stat Clock") !== -1) query+= ";strange";
				if(classes.indexOf("uncraft")!==-1) query+= ";uncraftable";

				window.open(query);

			}},
		}
	});


